# 1 "program-logic/lexer-parser-rules/Lexer.fsl"
 

module Lexer

open Microsoft.FSharp.Text.Lexing
open System
open Parser
exception SyntaxError of string

let lexeme = LexBuffer.LexemeString

let newline (lexbuf: LexBuffer<_>) = 
  lexbuf.StartPos <- lexbuf.StartPos.NextLine

let trimStringQuotes (str: string) =
    str.Substring(1, str.Length - 2)

let parseNum (str: string) = 
    let sign = str.[0]
    let numParts = 
        str
            .Substring(1, str.Length - 1)
            .Split(':') 
            |> Array.fold (fun num (str) -> 
                match str with 
                | "zero" when num = 0 -> num 
                | "zero" when num <> 0 -> num * 10 
                | "one" -> num * 10 + 1
                | "two" -> num * 10 + 2
                | "three" -> num * 10 + 3
                | "four" -> num * 10 + 4
                | "five" -> num * 10 + 5
                | "six" -> num * 10 + 6
                | "seven" -> num * 10 + 7
                | "eight" -> num * 10 + 8
                | "nine" -> num * 10 + 9
                | _ -> num)
            0

    if sign = '-' then -numParts
    else numParts

let reserved = [
    "INT"; "STR"; "BOOL"; "TRUE"; "FALSE"; "THEN"; "ELSE";
    "IF"; "WHILE"; "FUN"; "RETURN"; "PRINT"; "PRINTLN"; "OR"; "AND";
]

let checkIfReserved (str: String) =
    match reserved |> List.tryFind (fun x -> x = str) with
    | None -> IDENTIFIER (str)
    | Some (r) -> 
        match r with 
        | "INT" -> INT
        | "STR" ->  STR
        | "BOOL" -> BOOL
        | "TRUE" -> BOOLEAN true 
        | "FALSE" -> BOOLEAN false 
        | "THEN" -> THEN 
        | "ELSE" -> ELSE 
        | "IF" -> IF 
        | "WHILE" -> WHILE 
        | "FUN" -> FUN 
        | "RETURN" -> RETURN 
        | "PRINT" -> PRINT 
        | "PRINTLN" -> PRINTLN
        | "OR" -> LOGICAL_OR 
        | "AND" -> LOGICAL_AND 
        | _ -> IDENTIFIER("reserved token missing")


